import React, { Component } from 'react';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <form>
            <label>
              Please tell us about yourself:
            </label><br/>

            <input id="firstName" type="text" placeholder="First name"></input><br/>
            <input id="lastName" type="text" placeholder="Last name"></input><br/>
            <input id="age" type="number" placeholder="Age"></input><br/>
            <input id="email" type="email" placeholder="Email address"></input><br/>

            <label>
              What type of business would you like to start?
            </label><br/>

            <ul id="business">
              <li><label>Real Estate<input type="checkbox" value="realEstate" /></label></li>
            </ul>
          </form>
        </header>
      </div>
    );
  }
}

export default App;
